import React from 'react';
import './HomePage.css';

let PostCollection = Backbone.Collection.extend({
    url: "http://localhost:3000/posts"
});

let posts = new PostCollection();
posts.fetch({
    success: function(){
        console.log(posts.pluck('title'));
    }
});

export const HomePage = () => {


    return(
        <div className="home-page">

        </div>
    )
}
